import React from 'react';

const Projects = () => {
  return (
    <div className="projects-container">
      <h2>My Projects and Researches</h2>
      <div className="project-item">
        <h5>Mobile Application for Disorder Students</h5>
        <p>Final Year Research-not completed yet</p>
        
      </div>
    </div>
  );
};

export default Projects;
